import React from "react";
import '../styles/styles.css'

function navBar() {
	return (
		<div>
			<nav className="nav_bar">
				<div className="logo">DeepWebDevs</div>
				<div>
					<a>Home</a>
					<a>About</a>
					<a>Projects</a>
				</div>
			</nav>
		</div>
	);
}

export default navBar;
